import React from "react";
import { Button } from "antd";
import { updateStoreToolId } from "../redux/toolSlice";
import { useDispatch, useSelector } from "react-redux";
export default function Graph() {
  const dispatch = useDispatch();
  const { toolID } = useSelector((state) => state.tool);
  return (
    <div>
      Graph
      <Button onClick={()=>
        dispatch(updateStoreToolId("change"))
      }>{toolID}</Button>
    </div>
  );
}
